3-28T12:57:16.493459Z","iopub.status.busy":"2022-03-28T12:57:16.491787Z","iopub.status.idle":"2022-03-28T12:57:16.532331Z","shell.execute_reply":"2022-03-28T12:57:16.529997Z"},"papermill":{"duration":0.254693,"end_time":"2022-03-28T12:57:16.532498","exception":false,"start_time":"2022-03-28T12:57:16.277805","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":[" MSE of CatBoost Model is:  10.12964 \n"," MAE of CatBoost Model is:  2.290954 \n"," RMSE of CatBoost Model is:  3.18271 \n"," R-squared of CatBoost Model is: 0.9646681\n"," The R-square of the test data is  0.965"]}],"source":["mse = mean((test_set$PE - y_pred)^2)\n","mae = caret::MAE(test_set$PE, y_pred)\n","rmse = caret::RMSE(test_set$PE, y_pred)\n","\n","# Calculate total sum of squares (tss)\n","y_test_mean = mean(test_set$PE)\n","tss =  sum((test_set$PE - y_test_mean)^2 )\n","\n","# Calculate residual sum of squares (rss)\n","residuals = test_set$PE - y_pred\n","rss =  sum(residuals^2)\n","\n","# Calculate R-squared\n","rsq  =  1 - (rss/tss)\n","\n","cat(\" MSE of CatBoost Model is: \", mse,\"\\n\", \"MAE of CatBoost Model is: \", mae,\"\\n\", \n","    \"RMSE of CatBoost Model is: \", rmse, \"\\n\", \"R-squared of CatBoost Model is:\", rsq)\n","cat('\\n The R-square of the test data is ', round(rsq,3))"]},{"cell_type":"code","execution_count":null,"id":"76dc35ec","metadata":{"papermill":{"duration":0.216247,"end_time":"2022-03-28T12:57:16.956127","exception":false,"start_time":"2022-03-28T12:57:16.73988","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":60.987255,"end_time":"2022-03-28T12:57:17.27771","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__note